import React from 'react';
import './Button.css';
export default function Button(props){

    function show(id){
        console.log(document.getElementById(`${id}`).innerHTML);
    }

    return(
        <>
            <div className="btn-layer">
                 <div className="btn" id={props.text1} style={{color:`${props.color}`}} onClick={show(props.text1)}>{props.text1}</div>
                 <div className="btn" id={props.text2}  style={{color:`${props.color}`}}>{props.text2}</div>
                 <div className="btn" id={props.text3}  style={{color:`${props.color}`}}>{props.text3}</div>
                 <div className="btn" id={props.text4}  style={{color:`${props.colorText}`,backgroundColor:`${props.bg}`}}>{props.text4}</div>
            </div>
        </>
    )
}
